
public class Series {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=35;i<100;i++)
		{
			if(i%3==0)
			{
				System.out.println("divisible by 3");
			}
		
			else if(i%2==0)
			{
				System.out.println("even");
			}
			else
			{
			System.out.println(i);
			}
		}
		//System.out.println(i);
	
	}

}
